window.bookSummaryJSON = "<p>The main character is a virtual game developer, who forces his way into the game. His character is a beetle who has lost his memory and doesn't consider himself a monster.</p> <p>He begins to upgrade his skills and get different achievements. He's trying to get to the truth as he pieces together shards of his memories, which he can't completely trust. As his intelligence grows, his memories are coming back.</p> <p>The realm he falls into is an underground world, which consists of 10 levels, with different caves, tunnels, and monsters.</p> <p>The dungeons are full of hostile beetles of different types, forms, and sizes. There are a clear hierarchy and division between them. At the same time, two endless wars are going on: one between monsters' clans, and the other between monsters and humans.</p>"; 
